  <!-- Beer Description -->\n        <div class="item-description-hideable item-description item-title-color">\n          <a class="link-font-color ut-more hide " href="#">More Info &#9656;</a>\n          <p class="link-font-color show-less item-title-color">Our bold and complex maibock-style ale that has been introducing countless beer drinkers to craft beer the world for over 25 years. Chock full of rich caramel malts and herbal hop nuances tied together with a balanced hop bitterness, this guy is still as drinkable as ever.</p>\n          <a href="#" class="ut-less hide link-font-color">Less Info &#9652;</a>\n        </div>\n\n      <!-- Beer Container List -->\n      <div class="container-list item-title-color">\n        <div class="with-price">\n        </div>\n        <div class="no-price">\n        </div>\n      </div>\n\n    </div>\n  </div>\n</div>\n<div class="item-bg-color menu-item clearfix">\n  <div class="beer">\n    <div class="label-image-hideable beer-label pull-left">\n      <a href="https://untappd.com/b/einbecker-brauhaus-einbecker-ainpockisch-bier-1378/1478517" class="link-font-color" target="_blank">\n        <img src="https://untappd.akamaized.net/site/beer_logos/beer-1478517_e2c36_sm.jpeg" alt="Einbecker Ainpöckisch Bier 1378">\n      </a>\n    </div>\n\n    <div class="beer-details item-title-color">\n      <!-- Beer Name + Style -->\n      <p class="beer-name">\n        <a href="https://untappd.com/b/einbecker-brauhaus-einbecker-ainpockisch-bier-1378/1478517" class="item-title-color" target="_blank">\n          <span class="tap-number-hideable"> </span>Einbecker Ainpöckisch Bier 1378 \n        </a>\n        <span class="beer-style beer-style-hideable item-title-color">Bock - Hell / Maibock / Lentebock</span>\n      </p>\n\n      <!-- Beer Details -->\n      <div class="item-meta item-title-color">\n          <div class="abv-hideable">\n            <span class="abv">6.7% ABV</span>\n          </div>\n          <div class="ibu-hideable">\n            <span class="ibu">30 IBU</span>\n          </div>\n        <div class="brewery-name-hideable">\n          <span class="brewery"><a href="https://untappd.com/brewery/484" class="item-title-color" target="_blank">Einbecker Brauhaus</a></span>\n        </div>\n          <div class="brewery-location-hideable">\n            <span class="location">Einbeck, Niedersachsen</span>\n          </div>\n          <div class="rating-hideable">\n            <span class="rating small r350"></span>\n          </div>\n      </div>\n\n      <!-- Beer Description -->\n        <div class="item-description-hideable item-description item-title-color">\n          <a class="link-font-color ut-more hide " href="#">More Info &#9656;</a>\n          <p class="link-font-color show-less item-title-color">Luther’s Favourite Beer.\nAinpöckisch Beer\n»The Original«\n\nNaturally cloudy and full-bodied – Genuine strong beer enjoyment.\n\nWhen Duke Erich handed Martin Luther a mug of Einbecker Beer at the Worms Reichstag in the year 1521 Martin Luther called out “the best drink known to man is called Ainpöckisch Beer.” His love to Katharina von Bora and to Ainpöckisch Beer was also shown at his wedding in Wittenberg when the council of the town of Wittenberg presented him a barrel of Einbecker as a gift. Already after his disputation in Leipzig in the year 1519 the council of the town of Wittenberg did welcome him by a jar of Einbecker Beer.</p>\n          <a href="#" class="ut-less hide link-font-color">Less Info &#9652;</a>\n        </div>\n\n      <!-- Beer Container List -->\n      <div class="container-list item-title-color">\n        <div class="with-price">\n        </div>\n        <div class="no-price">\n        </div>\n      </div>\n\n    </div>\n  </div>\n</div>\n<div class="item-bg-color menu-item clearfix">\n  <div class="beer">\n    <div class="label-image-hideable beer-label pull-left">\n      <a href="https://untappd.com/b/bayerische-staatsbrauerei-weihenstephan-weihenstephaner-vitus/7408" class="link-font-color" target="_blank">\n        <img src="https://untappd.akamaized.net/site/beer_logos/beer-7408_a806b_sm.jpeg" alt="Weihenstephaner Vitus">\n      </a>\n    </div>\n\n    <div class="beer-details item-title-color">\n      <!-- Beer Name + Style -->\n      <p class="beer-name">\n        <a href="https://untappd.com/b/bayerische-staatsbrauerei-weihenstephan-weihenstephaner-vitus/7408" class="item-title-color" target="_blank">\n          <span class="tap-number-hideable"> </span>Weihenstephaner Vitus \n        </a>\n        <span class="beer-style beer-style-hideable item-title-color">Bock - Weizenbock</span>\n      </p>\n\n      <!-- Beer Details -->\n      <div class="item-meta item-title-color">\n          <div class="abv-hideable">\n            <span class="abv">7.7% ABV</span>\n          </div>\n          <div class="ibu-hideable">\n            <span class="ibu">17 IBU</span>\n          </div>\n        <div class="brewery-name-hideable">\n          <span class="brewery"><a href="https://untappd.com/brewery/88" class="item-title-color" target="_blank">Bayerische Staatsbrauerei Weihenstephan</a></span>\n        </div>\n          <div class="brewery-location-hideable">\n            <span class="location">Freising, Bayern</span>\n          </div>\n          <div class="rating-hideable">\n            <span class="rating small r375"></span>\n          </div>\n      </div>\n\n      <!-- Beer Description -->\n        <div class="item-description-hideable item-description item-title-color">\n          <a class="link-font-color ut-more hide " href="#">More Info &#9656;</a>\n          <p class="link-font-color show-less item-title-color">Our light-coloured, spicy single-bock, “Vitus” is saturated with fine yeast and a creamy foam. It is a specialty with a round character based on the extra long storage time. The fruity smell of dried apricots joins aromas of citrus, cloves and hints of banana. Full-bodied and sparkling with an effervescent mouthfeel. Thus, the Vitus does not taste like a typical Bock beer but more like a noble, fruity wheat beer. Perfect with red meat, strong cheese and also able to guide desserts. Brewed according to our centuries-old brewing tradition on the Weihenstephan hill.</p>\n          <a href="#" class="ut-less hide link-font-color">Less Info &#9652;</a>\n        </div>\n\n      <!-- Beer Container List -->\n      <div class="container-list item-title-color">\n        <div class="with-price">\n        </div>\n        <div class="no-price">\n        </div>\n      </div>\n\n    </div>\n  </div>\n</div>\n\n</div>\n\n<div class="pagination-container">\n  Displaying <b>all 3</b> items\n\n\n  \n</div>\n\n                </div>\n              </div>\n              <div class="section item-bg-color">\n                <div class="section-header-bg-color section-title-color section-heading padding-left padding-right">\n                  <div class="section-name">Brown</div>\n                </div>\n                <div class="section-items-container">\n                  <div class="item-bg-color menu-items-container padding-left padding-right">\n  <div class="item-bg-color menu-item clearfix">\n  <div class="beer">\n    <div class="label-image-hideable beer-label pull-left">\n      <a href="https://untappd.com/b/rocket-republic-brewing-company-tm-astronut-brown-ale/379144" class="link-font-color" target="_blank">\n        <img src="https://untappd.akamaized.net/site/beer_logos/beer-379144_15c2c_sm.jpeg" alt="AstroNut Brown Ale">\n      </a>\n    </div>\n\n    <div class="beer-details item-title-color">\n      <!-- Beer Name + Style -->\n      <p class="beer-name">\n        <a href="https://untappd.com/b/rocket-republic-brewing-company-tm-astronut-brown-ale/379144" class="item-title-color" target="_blank">\n          <span class="tap-number-hideable"> </span>AstroNut Brown Ale \n        </a>\n        <span class="beer-style beer-style-hideable item-title-color">Brown Ale - American</span>\